import MC68000 from './mc68000.js';

export default class FD1089B extends MC68000 {
	code_key = new Uint8Array(0x1000);
	data_key = new Uint8Array(0x1000);

	constructor(key, clock) {
		super(clock);
		this.code_key.set(key.subarray(0, 0x1000));
		this.data_key.set(key.subarray(0x1000));
	}

	txread16(addr) {
		const key = this.code_key[addr >> 12 & 0xff0 | addr >> 6 & 8 | addr >> 3 & 4 | addr >> 2 & 2 | addr >> 1 & 1] << 8;
		const val = super.txread16(addr), src = code_table[key | val >> 8 & 0xfc | val >> 5 & 2 | val >> 3 & 1];
		return val & ~0xfc48 | src << 8 & 0xfc00 | src << 5 & 0x40 | src << 3 & 8;
	}

	read16(addr) {
		const key = this.data_key[addr >> 12 & 0xff0 | addr >> 6 & 8 | addr >> 3 & 4 | addr >> 2 & 2 | addr >> 1 & 1] << 8;
		const val = super.read16(addr), src = data_table[key | val >> 8 & 0xfc | val >> 5 & 2 | val >> 3 & 1];
		return val & ~0xfc48 | src << 8 & 0xfc00 | src << 5 & 0x40 | src << 3 & 8;
	}
}

